pragma solidity >= 0.4.0  < 0.9.0;

import "@openzeppelin/contracts/access/Ownable.sol";
import "@openzeppelin/contracts/token/ERC721/ERC721.sol";

library LibString {
    function toString(uint256 value) internal pure returns (string memory) {

        if (value == 0) {
            return "0";
        }
        uint256 temp = value;
        uint256 digits;
        while (temp != 0) {
            digits++;
            temp /= 10;
        }
        bytes memory buffer = new bytes(digits);
        while (value != 0) {
            digits -= 1;
            buffer[digits] = bytes1(uint8(48 + uint256(value % 10)));
            value /= 10;
        }
        return string(buffer);
    }

}

library LibBase64 {
    bytes internal constant TABLE =
        "ABCDEFGHIJKLMNOPQRSTUVWXYZabcdefghijklmnopqrstuvwxyz0123456789+/";

    /// @notice Encodes some bytes to the base64 representation
    function encode(bytes memory data) internal pure returns (string memory) {
        uint256 len = data.length;
        if (len == 0) return "";

        // multiply by 4/3 rounded up
        uint256 encodedLen = 4 * ((len + 2) / 3);

        // Add some extra buffer at the end
        bytes memory result = new bytes(encodedLen + 32);

        bytes memory table = TABLE;

        assembly {
            let tablePtr := add(table, 1)
            let resultPtr := add(result, 32)

            for {
                let i := 0
            } lt(i, len) {

            } {
                i := add(i, 3)
                let input := and(mload(add(data, i)), 0xffffff)

                let out := mload(add(tablePtr, and(shr(18, input), 0x3F)))
                out := shl(8, out)
                out := add(
                    out,
                    and(mload(add(tablePtr, and(shr(12, input), 0x3F))), 0xFF)
                )
                out := shl(8, out)
                out := add(
                    out,
                    and(mload(add(tablePtr, and(shr(6, input), 0x3F))), 0xFF)
                )
                out := shl(8, out)
                out := add(
                    out,
                    and(mload(add(tablePtr, and(input, 0x3F))), 0xFF)
                )
                out := shl(224, out)

                mstore(resultPtr, out)

                resultPtr := add(resultPtr, 4)
            }

            switch mod(len, 3)
            case 1 {
                mstore(sub(resultPtr, 2), shl(240, 0x3d3d))
            }
            case 2 {
                mstore(sub(resultPtr, 1), shl(248, 0x3d))
            }

            mstore(result, encodedLen)
        }

        return string(result);
    }
}

contract MPTEST is Ownable, ERC721{

    string constant private TOKEN_NAME = "MPTEST";
    string constant private TOKEN_SYMBOL = "MPTEST";
    uint256 constant private TOKEN_ID_OFFSET = 1;
    uint256[] private _planTypes;

    // トークンタイプが参照するデータ（参照先のURL／名前(属性)／デスクリプション）
    mapping( uint256 => string ) private _planImageUrls;
    mapping( uint256 => string ) private _planDescriptions;

    constructor() Ownable() ERC721( TOKEN_NAME, TOKEN_SYMBOL ){}

    //Function to mint all users corresponding to the same image at once.
    function batchCreateTokenUsingImgUrl(address[] memory nftOwners,uint256 planType)
        external
        onlyOwner
    {
        uint256 numOfAddress = nftOwners.length;
        for(uint256 i = 0;i < numOfAddress;i++){
            address nftOwner = nftOwners[i];
            uint256 newItemId = TOKEN_ID_OFFSET + _planTypes.length;
            _safeMint(nftOwner,newItemId);
            _planTypes.push(planType);
        }
    }

    function createToken(uint256 planType) external returns(uint256){
        uint256 newItemId = TOKEN_ID_OFFSET + _planTypes.length;
        _safeMint(_msgSender(),newItemId);
        _planTypes.push(planType);
        return newItemId;
    }

    function tokenURI(uint256 tokenId)
        public
        view
        override
        returns(string memory)
    {
        require( _exists( tokenId ), "nonexsitent token" );
        uint256 planType = _planTypes[tokenId - TOKEN_ID_OFFSET];

        string memory name = string( abi.encodePacked( '"name":"', TOKEN_SYMBOL, ' #', LibString.toString(tokenId), '"' ) );
        string memory description = string( abi.encodePacked( '"description":"', _planDescriptions[planType], '"' ) );
        string memory image = string( abi.encodePacked( '"image":"', _planImageUrls[planType], '"' ) );

         // メタデータの内容を確認するときは[Base64]のエンコードを無効にした文字列を返してあげれば良い
        string memory json = LibBase64.encode(
            bytes(
                string(
                    abi.encodePacked(
                        '{',
                        name,
                        ',',
                        description,
                        ',',
                        image,
                        '}'
                    )
                )
            )
        );

        string memory output = string(
            abi.encodePacked("data:application/json;base64,", json)
        );
        return output;
    }

    function totalSupply() external view returns(uint256){
        return _planTypes.length;
    }

    function setPlan( uint256 plan, string calldata url, string calldata description ) external onlyOwner {
        _planImageUrls[plan] = url;
        _planDescriptions[plan] = description;
    }

    function planImageUrl( uint256 plan ) external view returns (string memory) { return( _planImageUrls[plan] ); }
    function planDescription( uint256 plan ) external view returns (string memory) { return( _planDescriptions[plan] ); }

}
